import logo from './logo.svg';
import './App.css';
import Welcome from './components/Welcome';

function App() {
  return (
    <div className="App">
      <header className="App-header">
         <Welcome name="Sara" />
         <img src={logo} className="App-logo" alt="logo" width="100px"/>
      </header>
    </div>
  );
}

export default App;
